import React from "react";
import { BrowserRouter as Router, Route, Link, Switch } from "react-router-dom";
import "./App.css";
import Content from "./components/Content";
import Footer from "./components/Footer";
import Navbar from "./components/Navbar";
import Aboutus from "./components/navbar_components/Aboutus";
import Cart from "./components/navbar_components/Cart";
import Contacts from "./components/navbar_components/Contacts";
import Distributionofgames from "./components/navbar_components/Distributionofgames";
import distributionofgames from "./components/navbar_components/Distributionofgames";
import Help from "./components/navbar_components/Help";
import Registration from "./components/navbar_components/Registration";

function App() {
  return (
    <Router>
      <div className="home">
        <Switch>
          <Navbar />
          <Content />

          <Route path="/cart">
            <Cart />
          </Route>

          <Route path="aboutus">
            <Aboutus />
          </Route>

          <Route path="contacts">
            <Contacts />
          </Route>

          <Route path="help">
            <Help />
          </Route>

          <Route path="registration">
            <Registration />
          </Route>

          <Route path="distributionofgames">
            <distributionofgames />
          </Route>

          <Footer />
        </Switch>
      </div>
    </Router>

  );
}

export default App;
